    "#### Data Description\n",
    "\n",
    "- Temperature (°C): Average temperature of the region. Under the name of Temperature.\n",
    "- Humidity (%): Relative humidity recorded in the region. Under the name of Humidity.\n",
    "- PM2.5 Concentration (µg/m³): Fine particulate matter levels. Under the name of PM2.5.\n",
    "- PM10 Concentration (µg/m³): Coarse particulate matter levels. Under the name of PM10.\n",
    "- NO2 Concentration (ppb): Nitrogen dioxide levels. Under the name of NO2.\n",
    "- SO2 Concentration (ppb): Sulfur dioxide levels. Under the name of SO2.\n",
    "- CO Concentration (ppm): Carbon monoxide levels. Under the name of CO.\n",
    "- Proximity to Industrial Areas (km): Distance to the nearest industrial zone. Under the name of Proximity_to_Industrial_Areas\n",
    "- Population Density (people/km²): Number of people per square kilometer in the region. Under the name of Population_Density.\n",
    "- Air Quality Levels: The response variable of the task. Classified by: a) \"Good\": Clean air with low pollution levels. b) \"Moderate\": Acceptable air quality but with some pollutants present. c) \"Poor\": Noticeable pollution that may cause health issues for sensitive groups. d) \"Hazardous\": Highly polluted air posing serious health risks to the population.\n"
   ]
  },
