   "source": [
    "# Set seed\n",
    "set.seed(1)\n",
    "\n",
    "# Split the data into training (60%), validation (20%), and testing (20%)\n",
    "trainIndex <- createDataPartition(data$Air.Quality.f, p = 0.6, list = FALSE)\n",
    "train_data <- data[trainIndex, ]\n",
    "temp_data <- data[-trainIndex, ]\n",
    "\n",
    "# Further split the remaining 40% into validation (20%) and testing (20%)\n",
    "valIndex <- createDataPartition(temp_data$Air.Quality.f, p = 0.5, list = FALSE)\n",
    "val_data <- temp_data[valIndex, ]\n",
    "test_data <- temp_data[-valIndex, ]\n",
    "\n",
    "# Check the sizes of the splits\n",
    "cat(\"Training data size:\", nrow(train_data), \"\\n\")\n",
    "cat(\"Validation data size:\", nrow(val_data), \"\\n\")\n",
    "cat(\"Testing data size:\", nrow(test_data), \"\\n\")"
   ]
  },
