    "# Model Tuning to find optimal mtry\n",
    "tuned_model <- tuneRF(\n",
    "    x = val_data %>% select(-Air.Quality.f, -Air.Quality),  # Exclude Air.Quality\n",
    "    y = val_data$Air.Quality.f,                            # Response variable\n",
    "    ntreeTry = 500,\n",
    "    stepFactor = 1.5,\n",
    "    improve = 0.01,\n",
    "    trace = TRUE\n",
    ")\n",
    "\n",
    "# Updating RF Model \n",
    "rf_model_refined <- randomForest(Air.Quality.f ~ .-Air.Quality, data = train_data, mtry = 2, ntree = 500)"
   ]
  },
